import { Carousel } from "react-bootstrap";
import autosalon from "./src/autosalon.jpeg";

const Contacts = (props) => {
  return (
    <Carousel>
      <Carousel.Item>
        <img className="d-block w-100" src={autosalon} alt="First slide" />
      </Carousel.Item>
    </Carousel>
  );
};

export default Contacts;
